interface GameOverProps {
    setGameOver: Function;
}

const GameOver = (props: GameOverProps) => {

    const Restart = () => {
        props.setGameOver(false);
    }

    return (
        <>
            <h1>Game Over!</h1>
            <button onClick={() => {Restart()}}>リスタート</button>
            <button onClick={() => {Home()}}>ホーム</button>
        </>
    );
};

export default GameOver;
